dot3InitializeMac = MibTableColumn((1, 3, 6, 1, 2, 1, 10, 7, 1, 1, 2), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("initialized", 1), ("uninitialized", 2)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dot3InitializeMac.setStatus('mandatory')
if mibBuilder.loadTexts: dot3InitializeMac.setDescription('The initialization status of the MAC and PLS (Physical Layer Signalling) subsystems for a particular interface. The value initialized(1) signifies that the subsystems for a particular interface have been previously initialized; the value uninitialized(2) signifies that they have not been previously initialized. Each alteration of an instance of this object to either of the values initialized(1) or uninitialized(2) is analogous to an invocation of the initializeMAC action defined in [9] and has the effect of (re-)initializing the MAC and PLS subsystems for the associated interface. In particular, all management counters pertaining to the MAC and PLS subsystems for said interface are reset to zero; the receive and transmit layer management state variables (receiveEnabled and transmitEnabled in [9]) are set to enable reception and transmission of frames; the promiscuous receive function is disabled; and multicast reception is disabled.')
dot3MacSubLayerStatus = MibTableColumn((1, 3, 6, 1, 2, 1, 10, 7, 1, 1, 3), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("enabled", 1), ("disabled", 2)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dot3MacSubLayerStatus.setStatus('mandatory')
if mibBuilder.loadTexts: dot3MacSubLayerStatus.setDescription("The operational status of the MAC sublayer for a particular interface. The value enabled(1) signifies that the MAC sublayer for said interface is operational for both transmitting and receiving frames -- that is, that the value of both the receive and transmit layer management state variables (receiveEnabled and transmitEnabled in [9]) for said interface are true. The value disabled(2) signifies that the MAC sublayer for said interface is not operational for either transmitting or receiving frames. In particular, the value of an instance of this object is disabled(2) whenever the value of the corresponding instance of the dot3Enabled object is false(2). Each alteration of an instance of this object to the value enabled(1) is analogous to an invocation of the enableMACSublayer action defined in [9] and has the effect of starting normal transmit and receive operations (from the ``idle'' state) on the associated interface. In particular, such an alteration has the effect of resetting the PLS for said interface and of setting the receive and transmit layer management state variables (receiveEnabled and transmitEnabled in [9]) to be true. Each alteration of an instance of this object to the value disabled(2) is analogous to an invocation of the disableMACSublayer action defined in [9] and has the effect of terminating transmit and receive operations on the associated interface. In particular, such an alteration has the effect of setting the receive and transmit layer management state variables (receiveEnabled and transmitEnabled in [9]) to be false. Any transmissions/receptions in progress are completed before operation is terminated.")
dot3MulticastReceiveStatus = MibTableColumn((1, 3, 6, 1, 2, 1, 10, 7, 1, 1, 4), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("enabled", 1), ("disabled", 2)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dot3MulticastReceiveStatus.setStatus('mandatory')
if mibBuilder.loadTexts: dot3MulticastReceiveStatus.setDescription('The multicast receive status for a particular interface. The value enabled(1) signifies that reception of multicast frames by the MAC sublayer is enabled on said interface. The value disabled(2) signifies that reception of multicast frames by the MAC sublayer is not enabled on said interface. Each alteration of an instance of this object to the value enabled(1) is analogous to an invocation of the enableMulticastReceive action defined in [9] and has the effect of enabling multicast frame reception on the associated interface. Actual reception of multicast frames is only possible on an interface when the values for the associated instances of the dot3MulticastReceiveStatus and dot3MacSubLayerStatus objects are enabled(1) and enabled(1), respectively. Each alteration of an instance of this object to the value disabled(2) is analogous to an invocation of the disableMulticastReceive action defined in [9] and has the effect of inhibiting multicast frame reception on the associated interface.')
dot3TxEnabled = MibTableColumn((1, 3, 6, 1, 2, 1, 10, 7, 1, 1, 5), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("true", 1), ("false", 2)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: dot3TxEnabled.setStatus('mandatory')
if mibBuilder.loadTexts: dot3TxEnabled.setDescription('The transmit layer management state variable (transmitEnabled as defined in [9]) for a particular interface. The value true(1) signifies that the MAC frame transmission is enabled on said interface. The value false(2) signifies that the MAC frame transmission is inhibited on said interface. In particular, the value of an instance of this object is false(2) whenever the value of the corresponding instance of the dot3MacSubLayerStatus object is disabled(2). Each alteration of an instance of this object to the value true(1) is analogous to an invocation of the enableTransmit action defined in [9] and has the effect of enabling MAC sublayer frame transmission on the associated interface. In particular, such an alteration has the effect of setting the transmit layer management state variable (transmitEnabled in [9]) for said interface to be true. Each alteration of an instance of this object to the value false(2) is analogous to an invocation of the disableTransmit action defined in [9] and has the effect of inhibiting MAC sublayer frame transmission on the associated interface. In particular, such an alteration has the effect of setting the transmit layer management state variable (transmitEnabled in [9]) for said interface to be false. Any transmissions in progress are completed before transmission is inhibited.')
